Latin Adultery - Bridgette B 

Actors: Bridgette B, Tony DeSergio

Release Date: January 20, 2011

Bridgette B. has a secret recipe for tacos. Her world famous &quot;Pink Taco &quot; has gained some acclaim, but she won't be able to keep up with the demand with the condition her kitchen is in. She called in a consultant to see what he can do to fix the place up, but then he hears about her signature dish. Any cook worth their salt gives free samples, and Bridgette is no exception. A little secret sauce on a pink taco, and she's back in business.
